import React, { Component } from 'react'
import { Line } from 'react-chartjs-2'

export default class OverTime extends Component {
  constructor() {
    super()
    this.state = {

    }
  }

  render() {

    let last30Days = {
      data: {
          labels: this.props.labels['30days'],
          datasets: [{
              label: 'Money Spent',
              // CHANGE 'DATA' TO DISPLAY DATA POINTS
              data: [...Array(30).keys()],
              backgroundColor: [
                  'rgba(0, 255, 0, .4)',
              ],
              borderColor: [
                  'green',
              ],
              borderWidth: 1
          }]
      }
    }

    let last12Weeks = {
      data: {
          labels: this.props.labels['12weeks'],
          datasets: [{
              label: 'Money Spent',
              // CHANGE 'DATA' TO DISPLAY DATA POINTS
              data: [...Array(12).keys()],
              backgroundColor: [
                  'rgba(0, 255, 0, .4)',
              ],
              borderColor: [
                  'green',
              ],
              borderWidth: 1
          }]
      }
    }

    let last12Months = {
      data: {
          labels: this.props.labels['12months'],
          datasets: [{
              label: 'Money Spent',
              // CHANGE 'DATA' TO DISPLAY DATA POINTS
              data: [...Array(12).keys()],
              backgroundColor: [
                  'rgba(0, 255, 0, .4)',
              ],
              borderColor: [
                  'green',
              ],
              borderWidth: 1
          }]
      }
    }

    return (
      <div>

        <Line
          data={last30Days.data}
          width={750}
          height={500}
          options={{
            title: {
              text: 'Session Winning Percentage',
              display: true,
              fontsize: 200
            },
            legend: {
              display: true,
              position: "bottom"
            }
          }}
        />

        <Line
          data={last12Weeks.data}
          width={750}
          height={500}
          options={{
            title: {
              text: 'Session Winning Percentage',
              display: true,
              fontsize: 200
            },
            legend: {
              display: true,
              position: "bottom"
            }
          }}
        />

        <Line
          data={last12Months.data}
          width={750}
          height={500}
          options={{
            title: {
              text: 'Session Winning Percentage',
              display: true,
              fontsize: 200
            },
            legend: {
              display: true,
              position: "bottom"
            }
          }}
        />

      </div>
    )
  }
}
